import React, { useState } from 'react';

const StuMedicalView = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [data, setData] = useState([
    { date: '2023-07-01', pdf: 'file1.pdf', reason: 'Document 1', status: 'Approved' },
    { date: '2023-07-02', pdf: 'file2.pdf', reason: 'Document 2', status: 'Pending' },
    { date: '2023-07-03', pdf: 'file3.pdf', reason: 'Document 3', status: 'Rejected' },
  ]);

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleAdd = () => {
    const newEntry = { date: '', pdf: '', reason: '', status: '' };
    setData([...data, newEntry]);
  };

  const filteredData = data.filter((row) => {
    if (row.status.toLowerCase().includes(searchQuery.toLowerCase())) {
      return row;
    }
    return false;
  });

  const tableRows = filteredData.map((row, index) => (
    <tr key={index}>
      <td>{row.date}</td>
      <td>{row.pdf}</td>
      <td>{row.reason}</td>
      <td>{row.status}</td>
    </tr>
  ));

  return (
    <div>
      <div>
        <input type="text" value={searchQuery} onChange={handleSearchChange} placeholder="Search..." />
        <button onClick={handleAdd}>Add</button>
      </div>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>PDF</th>
            <th>Reason</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {tableRows}
        </tbody>
      </table>
    </div>
  );
};

export default StuMedicalView;
